// src/App.js
import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Home from './Home';
import Contacts from './Contacts';
import IndividualContact from './IndividualContact'; // Import the new component

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/contacts" element={<Contacts />} />
        <Route path="/contact" element={<IndividualContact />} /> {/* Add this line */}
      </Routes>
    </Router>
  );
}

export default App;
